(5, 'Date time format', 'date_time_format', 'd/m/Y H:i:s', 'Date time format in php', '', 'string', 'Local', 5),
(6, 'Date format', 'date_format', 'd/m/Y', 'Date format in php', '', 'string', 'Local', 0),
